        <Container maxWidth='sm'>
            <p>Alexander Arvebratt</p>
            <a>
                <StyledSpan></StyledSpan>
                <StyledSpan></StyledSpan>
                <StyledSpan></StyledSpan>
            </a>
        </Container>
    );
};

export default Home;
